import React from 'react';
import { Row, Col, Card } from 'antd';
import styles from'./index.module.less';

const Home = () => {
    return (
        <div className={styles.container}>
            <Row gutter={24}>
                <Col lg={7} md={24}>
                    <Card bordered={false} style={{ marginBottom: 24 }}>
                        asdf
                    </Card>
                </Col>
                <Col lg={17} md={24}>
                    <Card
                        bordered={false}
                        tabList={[{
                            key: 'articles',
                            tab: (
                                <span>
                                    articles <span>(8)</span>
                                </span>
                            )
                        }, {
                            key: 'applications',
                            tab: (
                                <span>
                                    applications <span>(10)</span>
                                </span>
                            )
                        }, {
                            key: 'projects',
                            tab: (
                                <span>
                                    projects <span></span>
                                </span>
                            )
                        }]}
                    >
                        qwer
                    </Card>
                </Col>
            </Row>
        </div>
    )
};

export default Home;
